import { useEffect, useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Autoplay } from "swiper/modules";
import "swiper/css";
import Tilt from "react-parallax-tilt";

export const SliderData = [
  {
    src: "https://img.freepik.com/free-vector/internship-job-training-illustration_23-2148751280.jpg",
    alt: "Image 1",
    data: "Mentorship",
  },
  {
    src: "https://img.freepik.com/free-vector/happy-seo-planning-campaign-social-media-isolated-flat-illustration_74855-10793.jpg",
    alt: "Image 2",
    data: "Best Content",
  },
  {
    src: "data:image/jpeg;base64,",
    alt: "Image 3",
    data: "Practice",
  },
  {
    src: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRis9DNOe7kx6UUn9_2m89GbjQeik3DRxCvGLS51ocPYabbE21vUqBfYvPxTm2_vQg8JWc&usqp=CAU",
    alt: "Image 4",
    data: "doubt resolution",
  },
  {
    src: "data:image/png;base64,",
    alt: "Image 4",
    data: " Project Based Learning",
  },
  {
    src: "https://tsdev-ts.s3.amazonaws.com/wp-content/uploads/2019/07/23115505/images.hrtechnologist.comemployee_career_developme-df4a5526184a44e3bd58e4a52b8324690c9052e8.jpg",
    alt: "Image 4",
    data: " Career Support",
  },
  {
    src: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQcrQSRhoPGn_gHD3kdlZEg4rdrv8bbSDy7oQ&s",
    alt: "Image 4",
    data: "meetings",
  },
  {
    src: "data:image/jpeg;base64,",
    alt: "Image 4",
    data: "Have A Team",
  },
  {
    src: "data:image/jpeg;base64,",
    alt: "Image 5",
    data: "Startup Support",
  },
];
const WhyUs = () => {
  return (
    <div className="relative mb-10 max-w-[550px] md:max-w-[650px] lg:max-w-[750px] p-4 mx-auto rounded-lg">
      <div className="text-2xl mb-5 font-bold flex justify-center uppercase">
        why us ?
      </div>
      <Tilt
        glareEnable={true}
        glareMaxOpacity={1}
        glareColor="lightblue"
        glarePosition="all"
        glareBorderRadius="10px"
      >
        <Swiper
          modules={[Autoplay]}
          autoplay={{ delay: 2000, reverseDirection: true }}
          loop={true}
          className="w-full"
        >
          {SliderData.map((image, index) => (
            <SwiperSlide key={index}>
              <div
                key={index}
                className="flex h-full items-center justify-between p-8 shadow-lg rounded-lg border border-gray-200 
                transition-all duration-300 hover:shadow-xl hover:border-gray-300"
              >
                <div className="text-center sm:text-left">
                  <h3 className="text-lg font-bold uppercase">{image.data}</h3>
                </div>
                <img
                  src={image.src}
                  width={100}
                  className="object-cover rounded-lg border-4 border-gray-300 sm:w-24 lg:w-28"
                />
              </div>
            </SwiperSlide>
          ))}
        </Swiper>
      </Tilt>
    </div>
  );
};

export default WhyUs;

